style:
.synonyms h3 {
                float: none;
            }

            td.voting {
                padding: 8px;
            }

            #syn-vote-table td {
                vertical-align: middle;
                clear: both;
            }

            .voting span {
                font-weight: bold;
                float: left;
                text-align: center;
                width: 19px;
                clear: left;
                font-size: 13px;
                line-height: 18px;
                cursor: pointer;
            }

            .voting .down {
                clear: left;
            }

            .voting .up, .voting .down {
                background: url(/Content/Img/minivote.gif) 0 33px;
                width: 19px;
                height: 11px;
                text-indent: -9999px;
                float: left;
                outline: none;
            }

            .voting .down {
                background-position: 0 22px;
            }

            .voting .down.voted {
                background-position: 0 11px;
            }

            .voting .up.voted {
                background-position: 0 0;
            }
